        def youtube_music_album_description_data
          {album:{description: "Cheek to Cheek is the first collaborative album by American singers Tony Bennett and Lady Gaga, released on September 19, 2014, by Columbia and Interscope Records. The two first met at the Robin Hood Foundation gala in New York City in 2011, and later recorded a rendition of \"The Lady Is a Tramp\" together, after which they began discussing plans of working on a jazz project. Cheek to Cheek consists of jazz standards by popular composers such as George Gershwin, Cole Porter, Jerome Kern, and Irving Berlin. It was inspired by Bennett and Gaga's desire to introduce the songs to a younger generation, since they believed these tracks have a universal appeal.\nIn January 2013, the album was announced by both artists and started its recording process after Gaga recovered from a hip surgery. It was recorded in New York City, where Bennett and Gaga were accompanied by a live band and jazz musicians associated with both artists. Gaga deviated from her previous contemporary pop albums as she wanted instead to create a jazz record. The release date of the album was delayed multiple times, and the final date was announced by Bennett and Gaga on The Today Show."}}
        end

